import React, { Component } from 'react';

class RecipientItem extends Component {
    render() {
        return (
            <div className="my-1">
                <button id={this.props.id} className="btn btn-primary rounded-pill text-nowrap">{this.props.firstName} {this.props.lastName}</button>
            </div>
        );
    }
}

export default RecipientItem;
